pragma solidity ^0.8.0;

import "../Repository/Repository.sol";

bytes32 constant RANDOM = keccak256("Random");

contract Random is RepositoryContract {

    function id() public view returns (bytes32) {return RANDOM;}

    uint256 public immutable _margin;
    uint256 private _addedgascost;
    uint256 private _addedcount;
    //uint256 private _fee;
    uint256 private _ptr;
    uint256 private _ptrstart;
    uint256 private _count;
    uint256 private _lastrandom;

    mapping(uint256 => uint256) private _usedrandoms;
    mapping(uint256 => uint256[256]) private _randoms;

    event Randoms(uint256[] random);
    event Remaining(uint256 count);
    event Reset(uint256 count);
    event Fee(uint256 fee);

    constructor(Repository rep_, uint margin_) RepositoryContract(rep_) {
        _margin = margin_;
    }

    function resetFee() public onlyOwner {
        _addedcount=0;
    }
    function purgeall() external onlyOwner {
        _ptrstart = _ptr;
        _count = 0;
    }

    function collect() external onlyOwner {
        payable(_msgSender()).transfer(address(this).balance);
    }

    function setAddedCost(uint256 gastcost_,uint256 count_) public onlyOperators {
        _addedgascost+=gastcost_;
        _addedcount+=count_;
        emit Fee(fee());
    }

    function fee() public view returns (uint256) {
        if (_addedcount==0)
            return 0;
        return _addedgascost*_margin/_addedcount;
    }

    function count() public view returns (uint256) {
        return _count;
    }


    function add(uint256[256] calldata newrandoms_) external onlyOperators {
        unchecked {
            _count += 256;
            _randoms[_ptr++] = newrandoms_;
        }
        if (fee()!=0 && address(this).balance>fee()*256)
            payable(_msgSender()).transfer(fee()*256);
    }

    function get(uint256 count_,uint256 random_,bool event_) public payable returns (uint256[] memory out_)
    {
        if (
            _msgSender() != ownerOf() &&
            !rep.isContract(_msgSender()) &&
            !rep.isOperator(_msgSender())
        ) {
            require(fee() != 0, "desactivated");
            require(msg.value >= fee()*count_, "Must pay fee");
            payable(_msgSender()).transfer(msg.value-(fee()*count_));
        }
        out_ = new uint256[](count_);
        for (uint i;i<count_;i++)
        {
            out_[i] = _random(random_);
            random_ = out_[i];
        }
        if (event_)
            emit Randoms(out_);
        emit Remaining(_count);
    }
    function get(uint256 count_,uint256 random_) public payable returns (uint256[] memory out_)
    {
        return get(count_,random_,false);
    }
    function getWithEvent(uint256 count_,uint256 random_) external payable returns (uint256[] memory out_)
    {
        return get(count_,random_,true);
    }

    function get(uint256 random_,bool event_) public payable returns (uint256 out_) {
        uint256[] memory values = get(1,random_,event_);
        return values[0];
    }
    function get(uint256 random_) public payable returns (uint256 out_) {
        return get(random_,false);
    }
    function getWithEvent(uint256 random_) public payable returns (uint256 out_) {
        return get(random_,true);
    }
    function _random(uint256 random_) internal returns (uint256) {
        for (
            uint256 i = block.number > 10 ? block.number - 10 : 1;
            i < block.number;
            i++
        ) random_ = uint256(keccak256(abi.encode(random_, blockhash(i))));
        random_ = uint256(keccak256(abi.encode(random_, _lastrandom)));
        uint8 k = uint8(random_ % 256);
        if (_count == 0) {
            _ptrstart = 0;
            for (uint256 p = _ptrstart; p < _ptr; p++) delete _usedrandoms[p];
            _count = _ptr * 256;
            emit Reset(_count);
        }
        unchecked {
            for (uint8 b = 0; b < 256; b++) {
                uint8 ki = k - b;
                for (uint256 p = _ptrstart; p < _ptr; p++)
                    if (_usedrandoms[p] & (1 << ki) == 0) {
                        _usedrandoms[p] |= 1 << ki;

                        random_ = _randoms[p][ki];
                        for (
                            uint256 i = block.number > 10
                                ? block.number - 10
                                : 1;
                            i < block.number;
                            i++
                        )
                            random_ = uint256(
                                keccak256(abi.encode(random_, blockhash(i)))
                            );
                        _lastrandom = random_;
                        _count--;
                        while (_usedrandoms[_ptrstart] == type(uint256).max)
                            _ptrstart++;
                        //if (_count % 256 == 0) emit RandomRemaining(_count);
                        return random_;
                    }
            }
            require(false, "no random available");
        }
    }

    function getfree(uint256 random_) public view returns (uint256) {
        for (
            uint256 i = block.number > 20 ? block.number - 20 : 1;
            i < block.number;
            i++
        ) random_ = uint256(keccak256(abi.encode(random_, blockhash(i))));
        random_ = uint256(keccak256(abi.encode(random_, _lastrandom)));
        unchecked {
            if (_ptrstart != _ptr) {
                uint256 k = uint8(random_ % (256 * _ptr));
                random_ = _randoms[k / 256][k % 256];
                for (
                    uint256 i = block.number > 20 ? block.number - 20 : 1;
                    i < block.number;
                    i++
                )
                    random_ = uint256(
                        keccak256(abi.encode(random_, blockhash(i)))
                    );
            }
        }
        return random_;
    }
}
